import React from 'react';
import { Formik, Form, Field } from 'formik';
import FormText from '../../Components/FormComponents/FormText';
import FormSubmitButton from '../../Components/FormComponents/FormSubmitButton';
import { makeStyles, Card, CardActions, CardContent, Typography } from '@material-ui/core'

const useStyles = makeStyles({
  root: {
    minWidth: '300px',
    width: '60%',
    margin: 'auto',
    marginTop: '10%',
  },
  bullet: {
    display: 'inline-block',
    margin: '0 2px',
    transform: 'scale(0.8)',
  },
  title: {
    fontSize: 14,
  },
  pos: {
    marginBottom: 12,
  },
});

const Login = () => {
  const classes = useStyles();

  const handleSubmit = (values) => {
    console.log(values);
  }

  const initialValues = {
    username: '',
    password: ''
  }
  return (
    <div className={classes.root}>
      <Card variant="outlined">
        <CardContent>
          <Typography variant="h5" component="h2" gutterBottom>My catalog</Typography>
          <Typography variant="body2" component="p">Login</Typography>
          <Formik
            initialValues={initialValues}
            onSubmit={handleSubmit}
          >
            {(
              values,
              // handleChange,
              ) => (
                <Form>
                  <Field
                    title="Username"
                    name="username"
                    type="text"
                    component={FormText}
                  />
                  <Field
                    title="Password"
                    name="password"
                    type="password"
                    component={FormText}
                  />
                  <FormSubmitButton />
                </Form>
              )}
          </Formik>
        </CardContent>
      </Card>
    </div>
  )
}

export default Login;
